import React from 'react'
import axios from 'axios'


const Popup = (props) => {
    const getDescription = (e) => {
        axios.get(`https://sightseer-backend.onrender.com/sights/${e.target.description}`).then((res) => {
            props.setTrips(res.data)
        })
    }

    return(
        <div>
            <button onClick={getDescription}>Show More</button>
            <p>{props.trip.description}</p>
        </div>
    )
}

export default Popup;
